import React from 'react';
import Layout from './Layout';

function App() {
  return (
    <Layout>
      <h2>WELCOME TO THE</h2>
      <h1>PHOTOGRAPHY STORE</h1>
      <h3>All photos taken by Doug Schallmoser</h3>
      <h3>Any photo you purchase will be mailed to you.</h3>
    </Layout>
  )
}

export default App;
